{
    "env": {
        "es2021": true,
        "node": true
    },
    "extends": [
        "eslint:recommended",
        "plugin:@typescript-eslint/recommended"
    ],
    "parser": "@typescript-eslint/parser",
    "parserOptions": {
        "ecmaVersion": 12,
        "sourceType": "module"
    },
    "plugins": [
        "@typescript-eslint"
    ],
    "rules": {
        "@typescript-eslint/no-explicit-any" : "off",
        "@typescript-eslint/no-empty-function" : "off",
        "no-async-promise-executor" : "off",
        "@typescript-eslint/ban-ts-comment" : "off"
    }
}

{
  "singleQuote": true
}

{
  "github": {
    "release": true
  },
  "hooks": {
    "after:bump": "npm run build && npx auto-changelog --ignore-commit-pattern \"ü•ö.*\" --commit-limit false -p -t keepachangelog && npm run docs && npm run release-image && git status",
    "before:git:release": "npm run release-image"
  },
  "git": {
    "changelog": "npx auto-changelog --stdout --commit-limit false --unreleased --template https://raw.githubusercontent.com/release-it/release-it/master/templates/changelog-compact.hbs --ignore-commit-pattern \"ü•ö.*\""
  },
  "npm": {
    "timeout": 60000
  }
}

